private List<String> readFieldNames(ResultSetMetaData metaData)
        throws SQLException {
  List<String> colNames = new ArrayList<String>();
  int count = metaData.getColumnCount();
  for (int i = 0; i < count; i++) {
    colNames.add(metaData.getColumnLabel(i + 1));
  }
  return colNames;
}

